import React from "react";

const Table = () =>{
    return(
        <div className="table">
            <h1>REACT TABLE</h1>
            <table>
                <thead>
                    <tr>
                        <th>S.</th>
                    </tr>
                </thead>
            </table>
        </div>
    )
   
}

export default Table;
